    value: In response to FEC letter dated 4/29/11 - on 8/2/10 the American Hospital
      Association PAC contributed at total of $3,000.  The October 2010 quarterly
      report reflected this contribution as $2,000 for 2010 Primary and $1,000 as
      2010 General.  This $3,000 contribution was refunded on 8/31/10 - it was incorrectly
      reported as 2010 General.  This amendment corrects the recording of the refund
      to $2,000 as 2010 Primary and $1,000 as 2010 General.  The Committee has conducted
      an internal review of its process and procedures to make certain that no contribution
      that meets the 48HR Note requirement were overlooked.  The Committee takes this
      regulation very seriously and has implemented bookkeeping and administrative
      changes to assure full compliance.  We maintain a hardcopy of every financial
      transaction, and would gladly provide this material upon request.  Thank you
      for your consideration.  If you should have questions or additional request,
